    <script>
        $(document).ready(function(){
            $('body').niceScroll({
		
		
		cursorcolor:'#e2d29a',
		cursorwidth:'10px',
		cursorborder:'1px solid #e2d29a',
		cursorborderradius:0,
		 autohidemode:false
		
	});

    $(document).on("click", ".toggle-btn", function() {
            var menuToggle=$(".menu");
           // menuToggle.addClass('menuSlide');
           
           if( !(menuToggle.hasClass("menuSlide"))){
           
            menuToggle.removeClass('NotSlide').addClass('menuSlide');
            $(".toggle-btn ").addClass("rotation");
           }
           else{
            menuToggle.removeClass('menuSlide').addClass('NotSlide');
            $(".toggle-btn ").removeClass("rotation");
           }
      
        });

    $(".menu a, #contactBtn").click(function(e) {
        //e.preventDefault();
        var target = $(this).attr('href');
    $('html, body').animate({
        scrollTop: ($(target).offset().top)
        
    }, 3000);
    $(".menu").removeClass('menuSlide');
    $(".toggle-btn ").removeClass("rotation");
});
$('#myfrom').on("submit", function(event){  
    event.preventDefault();
    
    var sender=$('#sender').val();
    var subject=$('#subject').val();
    var message=$('#message').val();
    //console.log(message);
   
         $.ajax({  
              url:"sending_mail.php",  
              method:"POST",  
              data:'sender=' + sender+'&subject='+ subject+'&message=' + message,  
              success:function(data){   
                   $(' #mail-status').html(data);  
              }  
         });  
    
}); 

        });

        $(window).on("load",function(){
	$(".loading .loader").fadeOut(4000,
	  function(){
		//$("body").css("overflow","auto");
		$(this).parent().fadeOut(4000,
		
		function(){
			
			
			
			$(this).remove();
			
		});
		
		
	
});

	
	
});
       
    </script>
